  <style>
    :root {
      --btn-top: 29.5%;
      --pop-dur: 1.6s; /* slower pop */
      --pulse-dur: 1.7s;
      --wave-dur: 1.7s; /* outward glow speed */
    }
    * { box-sizing: border-box; margin: 0; padding: 0; }
    html, body { height: 100%; background: #0b0b0b; overflow-x: hidden; font-family: 'Montserrat', system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; }
    .wrap { position: relative; min-height: 100vh; width: 100%; }
    .bg { display: block; width: 100%; height: auto; background: #000; }
    .cta-wrap {
      position: absolute; top: var(--btn-top); left: 50%;
      transform: translate(-50%, -50%) scale(0.9);
      z-index: 10; width: min(86vw, 480px);
      text-align:center;
      animation: popIn var(--pop-dur) cubic-bezier(.2,.9,.25,1.2) forwards,
                 pulse var(--pulse-dur) calc(var(--pop-dur) + .2s) ease-in-out infinite;
      isolation:isolate;
    }
    @keyframes popIn { 0%{transform:translate(-50%,-50%) scale(.72);opacity:0;filter:blur(2px)} 60%{transform:translate(-50%,-50%) scale(1.06);opacity:1;filter:blur(0)} 100%{transform:translate(-50%,-50%) scale(1.0)} }
    @keyframes pulse { 0%,100%{transform:translate(-50%,-50%) scale(1.0)} 50%{transform:translate(-50%,-50%) scale(1.06)} }
    .cta-btn {
      display:block; width:100%; padding:18px 28px; border:none; border-radius:24px;
      color:#000000; text-decoration:none; font-weight:900; letter-spacing:.4px;
      font-size: clamp(16px, 4.2vw, 26px);
      background: linear-gradient(180deg, #36d46e 0%, #16b24f 55%, #0a6a2e 100%);
      box-shadow: 0 18px 32px rgba(60,220,120,.30), 0 6px 0 rgba(0,0,0,.25),
                  inset 0 2px 8px rgba(255,255,255,.35), inset 0 -10px 22px rgba(0,0,0,.22);
      position:relative; user-select:none; -webkit-tap-highlight-color:transparent;
      text-shadow: 0 1px 2px rgba(0,0,0,.35), 0 6px 14px rgba(0,0,0,.25);
      z-index:2;
    }
    .cta-btn::before {
      content:""; position:absolute; left:12px; right:12px; top:10px; height:38%;
      border-radius:18px; background:linear-gradient(to bottom, rgba(255,255,255,.55), rgba(255,255,255,0)); pointer-events:none;
    }
    .glow-base { position:absolute; inset:0px; border-radius:34px; box-shadow:0 0 80px 30px rgba(60,220,120,0.40); z-index:1; }
    .glow-wave {
      position:absolute; inset:-0px; border-radius:34px; z-index:0; pointer-events:none;
      box-shadow:0 0 40px 10px rgba(60,220,120,0.55);
      animation: wave var(--wave-dur) ease-out infinite;
    }
    @keyframes wave { 0%{transform:scale(1);opacity:.6;box-shadow:0 0 40px 10px rgba(60,220,120,.55)} 99%{transform:scale(1.45);opacity:0;box-shadow:0 0 70px 24px rgba(60,220,120,0)} 100%{transform:scale(1);opacity:0;box-shadow:0 0 0 0 rgba(60,220,120,0)} }
    @media (max-width:380px) { .cta-btn { padding:16px 22px; border-radius:20px; } .cta-wrap { width: 90vw; } }
  </style>
